using Newtonsoft.Json;
using System.Numerics;
using System.Web.Http;

namespace Football_Two.Services
{
    public class GetOdds : ApiController
    {
        public GetOdds() { }

        string queryString = "?apiKey=b4771ec8a0f4cc136b356b91482fb4d7&regions=us&markets=h2h,spreads&oddsFormat=american";

        string jsonResponse;
        List<BettingLine> bettingLines = new List<BettingLine>();

        DataAccess dataAccess = new DataAccess();

        private static HttpClient sharedClient = new()
        {
            BaseAddress = new Uri("https://api.the-odds-api.com/v4/sports/americanfootball_nfl/odds/")
        };

        public async Task<int> GetLatestOdds(int scheduleWeek = 1)
        {
            int rc = 0;

            //await CallOddsApi();
            TestResponse();

            ParseApiResponse();

            PopulateRepository();

            return rc;
        }

        public async Task<int> CallOddsApi()
        {
            int rc = 0;
            try
            {
                using HttpResponseMessage response = await sharedClient.GetAsync(queryString);

                response.EnsureSuccessStatusCode();
                jsonResponse = await response.Content.ReadAsStringAsync();

                return rc;
            }
            catch (Exception ex)
            {
                throw;
            }
        }

        private void ParseApiResponse()
        {
            try
            {
                bettingLines = JsonConvert.DeserializeObject<List<BettingLine>>(jsonResponse);
            }
            catch (Exception ex)
            {

                throw;
            }
        }

        private void PopulateRepository()
        {
            foreach (BettingLine line in bettingLines) 
            {
                int gameId = GetGameId(line);

                foreach (Bookmaker bookmaker in line.bookmakers)
                {
                    int bookMakerId = dataAccess.BookMakerIdQuery(bookmaker.key, bookmaker.title);
                    if (bookMakerId > 0)
                    {
                        foreach (Market market in bookmaker.markets)
                        {
                            foreach (Outcome outcome in market.outcomes)
                            {
                                dataAccess.LineByTeamInsert(gameId, bookMakerId, market.key, Convert.ToDateTime(market.last_update), outcome);
                            }
                        }
                    }
                }
            }
        }

        private int GetGameId(BettingLine line)
        {
            DateTime utcCommeceTime = Convert.ToDateTime(line.commence_time);
            //DateTime utc = DateTime.SpecifyKind(utcRaw, DateTimeKind.Utc);
            //TimeZoneInfo tzi = TimeZoneInfo.Local;
            //DateTime est = TimeZoneInfo.ConvertTimeFromUtc(utc, tzi);


            int gameId = dataAccess.GameIdQuery(line.home_team, line.away_team, utcCommeceTime);
            if (gameId == -1)
            {
                gameId = dataAccess.GameInsert(line.home_team, line.away_team, utcCommeceTime);
            }
            return gameId;
        }


